import React from 'react'
import styled from "styled-components"

const Container = styled.div`
    width: 100%;
    height: 80px;
    background-color: #F6F9FC;
    font-family: 'Lato', sans-serif;
`

const ContentContainer = styled.div`
    width: 1100px;
    padding-top: 30px;
    margin-left: 50%;
    transform: translateX(-50%);
    display: flex;
`

const Name = styled.h4`
    font-size: 16px;
    font-weight: 300;
    font-style: italic;
`

const NameBold = styled.span`
    font-weight: 600;
`

const Emoji = styled.span`
    font-style: normal;
    margin-left: 6px;
    font-size: 14px;
`

const NavLinkContainer = styled.div`
    position: absolute;
    right: 0;
`

const NavLinkList = styled.ul`
    display: flex;
    list-style: none;
    font-size: 14px;
    font-weight: 300;
`

const NavLink = styled.li`
    margin-right: 40px;
`

export default function NavBar () {
    return (
    <Container>
            <ContentContainer>
                <Name><NameBold>Ben</NameBold> DiMarco <Emoji>ðŸ‘‹</Emoji></Name>
                <NavLinkContainer>
                    <NavLinkList>
                        <li className="nav-link"><a className="nav-btn">About Me</a></li>
                        <li className="nav-link"><a className="nav-btn">My Projects</a></li>
                        <li className="nav-link"><a className="nav-btn">Get In Touch</a></li>
                        <li className="nav-link"><a className="nav-btn">O</a></li>
                    </NavLinkList>
                </NavLinkContainer>
            </ContentContainer>
        </Container>
    )
}
